import React from 'react';
import home_page_pic from '../home_page_pic.png';
import {
    BrowserRouter as Router,
    Route,
    Link,
    Routes
} from 'react-router-dom';

function Home() {
    return (
        <Router>
            <div>
                <div class="title-container">
                    <h1 id="home-title">Find your communication skills gap</h1>
                </div>
                <div class="feature-buttons">
                    <img src={home_page_pic} className="home_page_pic" alt="home page picture" />
                    <button type="button" class="btn btn-primary home-buttons">Skill Search</button>
                    <button type="button" class="btn btn-primary home-buttons">Resume Analysis</button>
                    <Link to="/" >Home</Link>
                </div>

                <Routes>
                    <Route exact path='/' element={<Home />}></Route>
                    <Route exact path='/skill-search' element={<SkillSearch />}></Route>
                    <Route exact path='/resume_analysis' element={<ResumeAnalysis />}></Route>
                    <Route exact path='/about' element={<About />}></Route>
                </Routes>

            </div>
        </Router>
    )
}
export default Home;
